import { FETCH_DATA, FILTER_DATA_COUNTRY } from '../Actions/types';



export default (state = [], action) => {
    switch (action.type) {
        case FETCH_DATA: 
        return action.payload;
        case FILTER_DATA_COUNTRY: 
        return {}
        default: 
        return state;
    }
}
